svg.script:
function init(evt)
{
console.log('Initialize interactivity')
if ( window.svgDocument == null )
{
svgDocument = evt.target.ownerDocument;
}
tooltip = svgDocument.getElementById('tooltip');
}
function ShowTooltip(evt,label)
{
tooltip.setAttributeNS(null,'x',evt.clientX-8);
tooltip.setAttributeNS(null,'y',evt.clientY-5);
tooltip.setAttributeNS(null,'visibility','visible');
tooltip.firstChild.data = label;
length = tooltip.getComputedTextLength();
tooltip_bg.setAttributeNS(null,'width',length+8);
}
function HideTooltip()
{
tooltip.setAttributeNS(null,'visibility','hidden');
}
function PrintInfo(evt,label)
{
console.log('Click info: '+label)
alert(label);
}
